Eigen::Matrix<double,3,3> CLASSNAME::get_mass_matrix_hh() const
{
   const auto QH1p = LOCALINPUT(QH1p);
   const auto QSp = LOCALINPUT(QSp);
   const auto QH2p = LOCALINPUT(QH2p);

   Eigen::Matrix<double,3,3> mass_matrix_hh;
   mass_matrix_hh(0,0) = mHd2 + 0.225*Sqr(g1)*Sqr(vd) + 0.375*Sqr(g2)*Sqr
      (vd) + 1.5*Sqr(gN)*Sqr(QH1p)*Sqr(vd) + 0.5*AbsSqr(Lambdax)*Sqr(vs) + 0.5*
      QH1p*QSp*Sqr(gN)*Sqr(vs) + 0.5*AbsSqr(Lambdax)*Sqr(vu) - 0.075*Sqr(g1)*
      Sqr(vu) - 0.125*Sqr(g2)*Sqr(vu) + 0.5*QH1p*QH2p*Sqr(gN)*Sqr(vu);
   mass_matrix_hh(0,1) = vd*vu*AbsSqr(Lambdax) - 0.35355339059327373*vs*
      Conj(TLambdax) - 0.15*vd*vu*Sqr(g1) - 0.25*vd*vu*Sqr(g2) + QH1p*QH2p*vd*
      vu*Sqr(gN) - 0.35355339059327373*vs*TLambdax;
   mass_matrix_hh(0,2) = vd*vs*AbsSqr(Lambdax) - 0.35355339059327373*vu*
      Conj(TLambdax) + QH1p*QSp*vd*vs*Sqr(gN) - 0.35355339059327373*vu*TLambdax
      ;
   mass_matrix_hh(1,0) = mass_matrix_hh(0,1);
   mass_matrix_hh(1,1) = mHu2 + 0.5*AbsSqr(Lambdax)*Sqr(vd) - 0.075*Sqr(
      g1)*Sqr(vd) - 0.125*Sqr(g2)*Sqr(vd) + 0.5*QH1p*QH2p*Sqr(gN)*Sqr(vd) + 0.5
      *AbsSqr(Lambdax)*Sqr(vs) + 0.5*QH2p*QSp*Sqr(gN)*Sqr(vs) + 0.225*Sqr(g1)*
      Sqr(vu) + 0.375*Sqr(g2)*Sqr(vu) + 1.5*Sqr(gN)*Sqr(QH2p)*Sqr(vu);
   mass_matrix_hh(1,2) = vs*vu*AbsSqr(Lambdax) - 0.35355339059327373*vd*
      Conj(TLambdax) + QH2p*QSp*vs*vu*Sqr(gN) - 0.35355339059327373*vd*TLambdax
      ;
   mass_matrix_hh(2,0) = mass_matrix_hh(0,2);
   mass_matrix_hh(2,1) = mass_matrix_hh(1,2);
   mass_matrix_hh(2,2) = ms2 + 0.5*AbsSqr(Lambdax)*Sqr(vd) + 0.5*QH1p*QSp
      *Sqr(gN)*Sqr(vd) + 1.5*Sqr(gN)*Sqr(QSp)*Sqr(vs) + 0.5*AbsSqr(Lambdax)*Sqr
      (vu) + 0.5*QH2p*QSp*Sqr(gN)*Sqr(vu);

   return mass_matrix_hh;
}

